    value: Dear Ms. Balderama
  - name: AMENDED CD
    number: '5'
    value: ' Pursuant to your letter dated September 28'
  - value: ' 2004'
  - value: ' I am filing the attached amended pre-primary report. As discussed in
      our numerous phone conversations'
  - value: ' said amendment reflects the following items that were adressed in said
      letter'
  - value: ' to wit: 1) The committee has refunded the excess contribution of Marilyn
      G. Robertson Misk. This refund will be reflected on an upcoming report covering
      this period. I am also forwarding to  you a hard copy of said refund for your
      records. 2) The August 18th contribution to Tim Bishop for congress should have
      been designated as a contribution towards his general election and said amendment
      reflects this designation. I am also forwarding you a copy of my letter to their
      campaing indicating the same. 3) The amendment reflects that the August 6 2004
      contribution to Bronx County Committee is from excess campaign funds. Also for
      the Democratic Organization'
  - value: ' the amendment reflects the excess campaign funds designation for the
      contributions made on 8/3/04. Additionally'
  - value: ' pursuant to our conversation'
  - value: ' please consider the contributions made to the Democratic Organization
      of Queens County on 4/1/04 and 5/20/04 as also from excess campaign funds. 4)
      The amendment reflects information subsequently obtained regarding the occupation
      and employer. Please note that the following information was received with regard
      to missing information from prior reports: Ajay Shah-president- PC Associates;
      Allen L. Thurgood-CEO-Rochdale COOP Group; Vartkes Balian-Self Employed - Builder;
