    for congress should have been designated as a contribution towards his general
    election and said amendment reflects this designation. I am also forwarding you
    a copy of my letter to their campaing indicating the same. 3) The amendment reflects
    that the August 6 2004 contribution to Bronx County Committee is from excess campaign
    funds. Also for the Democratic Organization, the amendment reflects the excess
    campaign funds designation for the contributions made on 8/3/04. Additionally,
    pursuant to our conversation, please consider the contributions made to the Democratic
    Organization of Queens County on 4/1/04 and 5/20/04 as also from excess campaign
    funds. 4) The amendment reflects information subsequently obtained regarding the
    occupation and employer. Please note that the following information was received
    with regard to missing information from prior reports: Ajay Shah-president- PC
    Associates; Allen L. Thurgood-CEO-Rochdale COOP Group; Vartkes Balian-Self Employed
    - Builder; Narandra Patel -self employed-hotelier; Antranig Sarkissian-banker
    for Citibank. With regard to the committees best efforts, please be advised of
    the following: a) the committee requests the occupation and employer in every
